import { Post } from "../post/post";

export class Utente {
    id_utente?: number;
    nome?: string;
    cognome?: string;
    email?: string;
    password?: string;
    articoli: Post[];
    postPreferiti: Post[];

  constructor(
    nome: string,
    cognome: string,
    email: string,
    password: string
  ) {
    this.nome = nome;
    this.cognome = cognome;
    this.email = email;
    this.password = password;
    this.articoli = [];
    this.postPreferiti = [];
  }   
}

// Il <?> è un operatore che permette di valutare prima l'esistenza della variabile a sx e poi procedere
